import React from "react";
import { useOutletContext } from "react-router-dom";

export default function TaskInfo() {
  const taskInfo = useOutletContext();
  return (
    <div className="taskInfo">
      <section>
        {taskInfo.bufferRequests}
      </section>
    </div>
  );
}
